import React, { useState } from 'react';
import { registerUser } from '../api/auth';

function Register() {
  const [formData, setFormData] = useState({
    ho: '',
    ten: '',
    soDienThoai: '',
    email: '',
    matKhau: '',
  });

  const [message, setMessage] = useState('');

  const handleChange = e => {
    setFormData({...formData, [e.target.name]: e.target.value});
  };

  const handleSubmit = async e => {
    e.preventDefault();

    // Chuẩn bị dữ liệu gửi backend (theo database bạn có thể map lại)
    const payload = {
      ho_ten: formData.ho + ' ' + formData.ten,
      so_dien_thoai: formData.soDienThoai,
      email: formData.email,
      mat_khau: formData.matKhau,
      ten_dang_nhap: formData.email, // bạn có thể sửa tùy
    };

    const result = await registerUser(payload);

    if (result.success) {
      setMessage('Đăng ký thành công! Bạn có thể đăng nhập ngay.');
      setFormData({ho:'', ten:'', soDienThoai:'', email:'', matKhau:''});
    } else {
      setMessage(result.message || 'Đăng ký thất bại.');
    }
  };

  return (
    <section className="register-section">
      <div className="register-container">
        <h2>THÔNG TIN CÁ NHÂN</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="ho">Họ *</label>
            <input
              type="text"
              id="ho"
              name="ho"
              placeholder="Họ"
              value={formData.ho}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="ten">Tên *</label>
            <input
              type="text"
              id="ten"
              name="ten"
              placeholder="Tên"
              value={formData.ten}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="soDienThoai">Số điện thoại *</label>
            <input
              type="tel"
              id="soDienThoai"
              name="soDienThoai"
              placeholder="Số điện thoại"
              value={formData.soDienThoai}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email *</label>
            <input
              type="email"
              id="email"
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="matKhau">Mật khẩu *</label>
            <input
              type="password"
              id="matKhau"
              name="matKhau"
              placeholder="Mật khẩu"
              value={formData.matKhau}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit" className="login-btn">Đăng ký</button>
        </form>
        <p>{message}</p>
        <p>
          Bạn đã có tài khoản? <a href="/login">Đăng nhập tại đây</a>
        </p>
        <div className="social-login">
          <button className="facebook" onClick={() => window.location.href="https://www.facebook.com/login"}>
            <img src="img/anh24.jpg" alt="Facebook" style={{width: 20, height: 20, marginRight: 5}} />
            Facebook
          </button>
          <button className="google" onClick={() => window.location.href="https://accounts.google.com"}>
            <img src="img/anh23.png" alt="Google" style={{width: 20, height: 20, marginRight: 5}} />
            Google
          </button>
        </div>
      </div>
    </section>
  );
}

export default Register;
